import React from "react"

function RenderObj(props) {
    return (
        <div>
            {
                Object.keys(props.details).map(priKey => {
                    if (!Number.isInteger(parseInt(priKey, 10))) {
                        console.log(`key: ${priKey}, value: ${props.details[priKey]}`)
                        return (
                            <div key={priKey}>
                                <span>{priKey}</span>{" "}
                                <span>{props.details[priKey]}</span>
                            </div>
                        )

                    }
                }
                )
            }
        </div>
    )
}

function ManageDetailsView(props) {

    return (
        <div>
            <table className="table">
                <thead>
                    <tr>
                        <th>Type</th>
                        <th>value</th>
                    </tr>
                </thead>
                <tbody>
                    <tr key="1">
                        {

                        }
                    </tr>
                </tbody>
            </table>
            <div>
                {
                    Object.keys(props.details).forEach(priKey => {
                        if (!Number.isInteger(parseInt(priKey, 10))) {
                            console.log(`key: ${priKey}, value: ${props.details[priKey]}`)
                            return (
                                <div>
                                    {props.details[priKey]}
                                </div>
                            )

                        }
                    }
                    )
                }
            </div>
        </div>
    )
}

export { RenderObj, ManageDetailsView };

